import React from 'react';
import { FaBriefcase, FaEnvelope, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css'
function NavigationItems() {

    return (
        <ul className="navigation_items">
            <li><FaHome /></li>
            <li><FaUser /></li>
            <li><FaGraduationCap /></li>
            <li><FaBriefcase /></li>
            <li><FaEnvelope /></li>
        </ul>   
        
      );
}

export default NavigationItems;
